import React from 'react';
import '../styles/AlertasTable.css';

function AlertasTable({ alertas }) {
  return (
    <div className="event-table">
      <h3>⚠️ Alertas - Carro + Animal ({alertas.length})</h3>
      <div className="table-wrapper">
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>ID Carro</th>
              <th>ID Animal</th>
              <th>Hora</th>
            </tr>
          </thead>
          <tbody>
            {alertas.length > 0 ? (
              alertas.map(alerta => {
                const hora = new Date(alerta.hora);
                return (
                  <tr key={alerta.id}>
                    <td>#{alerta.id}</td>
                    <td>#{alerta.evento_carro_id}</td>
                    <td>#{alerta.evento_animal_id}</td>
                    <td>{hora.toLocaleTimeString('es-ES')}</td>
                  </tr>
                );
              })
            ) : (
              <tr><td colSpan="4" className="empty">Sin alertas</td></tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default React.memo(AlertasTable);
